  [],\n\t\"revision_timestamp\": \"2015-05-06T21:18:50.233401\",\n\t\"name\": \"low-toxicity-corrosion-inhibitors-for-smart-coatings-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Kennedy Space Center (KSC) is located
  near one of the most corrosive natural environments in the world.  Corrosion of
  KSC ground assets is exacerbated by the highly acidic exhaust of the Shuttle Solid
  Rocket Boosters (SRBs). During launch approximately 17 tons of hydrochloric acid
  are generated from the SRB exhausts. Thus while the launches are infrequent, they
  produce a highly acidic environment on coated structures leading to excessive corrosion.
  \ To mitigate the corrosion of carbon steel structures in and near the launch areas,
  KSC uses solvent-based topcoated inorganic zinc rich coatings. Regulations arising
  from Clean Air and other environmental legislation restrict the use of most solvents
  in paints and may restrict the use of inorganic zinc rich protective coatings. TDA
  will produce and test environmentally friendly smart coatings using its low-cost
  nanostructured carriers for corrosion inhibitors that provide smart release of the
  corrosion inhibitors via both pH-triggered and controlled release mechanisms. In
  the Phase I program TDA will demonstrate that its smart materials approach can provide
  higher-performance, environmentally-friendly protective coatings for NASA infrastructure
  and equipment. At the end of the Phase II effort we expect the technology to be
  at a technology readiness level of seven to eight. \",\n\t\"license_title\": \"U.S.
